    // Store Candidates Count
    uint public paymentsCount;

    // voted event
    event votedEvent (
        uint indexed _candidateId
    );

    constructor() public{
        addPayment("Advance","Avdvance for UI","15000");
        addPayment("Backend payment","Payment for backend development","60000");
    }

    function addPayment (string memory _name, string memory _description, string memory _money) private{
        paymentsCount ++;
        payments[paymentsCount] = Payment(paymentsCount, _name, _description,  _money);
    }

}
